export default function CreatedApplicationList({ sentApplications }) {
  return (
    <div className="p-5">
      <p className="fs-1 mb-5">My Applications List</p>
      <div className="w-100 border border-success-subtle p-3 rounded">
        {sentApplications.map((cur) => (
          <SentApplicationList
            key={cur.sentApplicationId}
            props={{
              profName: cur.professorName,
              department: cur.department,
              status: cur.status,
              decision: cur.decision,
              sentApplicationId: cur.sentApplicationId,
              projectName: cur.projectName,
            }}
          />
        ))}
      </div>
    </div>
  );
}

function SentApplicationList({ props }) {
  return (
    <div>
      {props.profName}
      <br />
      {props.department}
    </div>
  );
}
